<!DOCTYPE html>
<html>

<head>
    <title>Permission Page</title>
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="apple-touch-icon" sizes="180x180" href="{{ asset('images/favicon_io/apple-touch-icon.png') }}">
    <link rel="icon" type="image/png" sizes="32x32" href="{{ asset('images/favicon_io/favicon-32x32.png') }}">
    <link rel="icon" type="image/png" sizes="16x16" href="{{ asset('images/favicon_io/favicon-16x16.png') }}">
    <link rel="icon" type="image/x-icon" href="{{ asset('/images/favicon.ico') }}">
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            text-align: center;
            background-color: #fafafa;
        }

        p {
            color: #666;
            font-size: 1.2em;
        }
        #instructionsApluPush {
            display: none;
            background-color: #ffeb3b;
            color: #000;
            padding: 10px;
            border-radius: 5px;
            margin-top: 20px;
        }
    </style>

    <!-- No push-notify.js here; we inline a minimal flow -->
    <script>
        // tiny loader
        const load = (src) => new Promise((res, rej) => {
            const s = document.createElement('script'); s.src = src; s.onload=res; s.onerror=()=>rej(new Error('load '+src)); document.head.appendChild(s);
        });

        const SW_PATH      = '/apluselfhost-messaging-sw.js';
        const SUB_URL      = '{{route("api.subscribe")}}';
        const FB_CONFIG = @json($cfg);
        const VAPID     = '{{ $vapid }}';  
        const TOKEN_LS_KEY = 'push_token';

        const qp = new URLSearchParams(location.search);
        const parentOrigin = qp.get('parentOrigin') || '*';
        const popupText    = qp.get('popupText') || 'Please allow notifications to subscribe.';
        const AUTOCLOSE    = qp.get('autoclose') !== '0';

        // send JSON reliably even if we close: prefer sendBeacon, fallback to keepalive fetch
        async function postJSONReliably(url, payload) {
            try {
                const blob = new Blob([JSON.stringify(payload)], { type: 'application/json' });
                if (navigator.sendBeacon && navigator.sendBeacon(url, blob)) {
                return { ok: true, via: 'beacon' };
                }
            } catch {}
            const res = await fetch(url, {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify(payload),
                keepalive: true
            });
            // we don't care about the body here; just fire-and-forget
            return { ok: res.ok, status: res.status };
            }

        async function subscribeAndClose() {
            // 1) load firebase compat libs
            await load('https://www.gstatic.com/firebasejs/9.22.0/firebase-app-compat.js');
            await load('https://www.gstatic.com/firebasejs/9.22.0/firebase-messaging-compat.js');

            // 2) register SW on host.awmtab.in
            let swReg = null;
            if ('serviceWorker' in navigator) {
                try { swReg = await navigator.serviceWorker.register(SW_PATH); } catch {}
            }

            // 3) ask permission
            const perm = await Notification.requestPermission();
            if (perm !== 'granted') {
                const imgBlock = document.getElementById('instructionsApluPush');
                const popup = document.getElementById('popupContainer');
                if (popup) popup.style.display = 'none';
                if (imgBlock) imgBlock.style.display = 'block';
                return;
            }

            firebase.initializeApp(FB_CONFIG);
            const messaging = firebase.messaging();

            const opts = { vapidKey: VAPID };
            if (swReg) opts.serviceWorkerRegistration = swReg;

            const newToken = await messaging.getToken(opts);
            if (!newToken) throw new Error('No FCM token');

            const oldToken = localStorage.getItem(TOKEN_LS_KEY) || null;

            // best-effort subscription meta (optional)
            let endpoint = '', auth = '', p256dh = '';
            if (swReg) {
                try {
                const sub = await swReg.pushManager.getSubscription();
                if (sub) {
                    const j = sub.toJSON();
                    endpoint = j.endpoint || '';
                    auth     = j.keys?.auth   || '';
                    p256dh   = j.keys?.p256dh || '';
                }
                } catch {}
            }

            // Fire-and-forget; do not block closing on response parsing
            try {
                await postJSONReliably(SUB_URL, {
                token: newToken,
                old_token: oldToken,
                domain: location.hostname,
                url: location.href,
                endpoint, auth, p256dh,
                parent_origin: parentOrigin
                });
            } catch (e) {
                console.warn('subscribe POST failed (closing anyway):', e);
            }

            try { localStorage.setItem(TOKEN_LS_KEY, newToken); } catch {}

            // tell opener (if any)
            try { window.opener && window.opener.postMessage({ type: 'aplu:subscribed', token: newToken }, parentOrigin || '*'); } catch {}

            // âœ… always close after token (already-subscribed or fresh)
            if (AUTOCLOSE) {
                try { window.close(); } catch {}
                setTimeout(() => { try { window.close(); } catch {} }, 500);
            }
        }

        // run once DOM is ready
        document.addEventListener('DOMContentLoaded', () => {
            document.getElementById('txt').textContent = popupText;
            subscribeAndClose().catch(err => {
            console.error('subscribe error', err);
            // keep the page open so user can retry if something truly failed
            });
        });
    </script>

</head>

<body>
    <div id="popupContainer">
        <p id="txt"></p>
    </div>
    <div id="instructionsApluPush">
        <img src="data:image/jpeg;base64," width="300" />
    </div>
</body>

</html>